    selector: 'app-child',
    templateUrl: './app.component.html',
    styleUrls: ['./app.component.scss'],
    standalone: true,
    providers: [AbobaService]
  })
  export class ChildComponent {
    constructor(private abobaService: AbobaService) {
      console.log(this.abobaService.getData())
    }
  }
